import React, { Component } from 'react'
import { Card } from 'react-bootstrap';
import DatePicker from "react-datepicker";
import axios from "axios";
import "react-datepicker/dist/react-datepicker.css";
export default class StylisList extends Component {
    state = {
        startDate: new Date()
      };
      handleBook = () =>
      {
        axios.post('http://localhost:2550/api/v1/bookings/newbooking',this.state)
      }

      handleChange = date => {
        this.setState({
          startDate: date
        });
      };
    render() {
        console.log(this.props.elm);
        return (
            <div>
    <Card body> Stylist Name :   {this.props.elm.first_name} {this.props.elm.last_name} 
    <br/>
    <h4>{ this.props.elm.email}</h4>
    <DatePicker
            selected={this.state.startDate}
            onChange={this.handleChange}
          />
          <button onClick={this.handleBook}>Book</button>
    </Card>
            </div>
        )
    }
}
